def smallestrange(nums):
    """
    :type nums: List[List[int]]
    :rtype: List[int]
    """
    num_len = len(nums)
    begin = 0
    end = 0
    interval = 1000000

    list_dict = {}  # 指针项
    for i in range(num_len):
        list_dict[i] = 0
        tmplist = nums[i]
        nums[i] = sorted(set(tmplist), key=tmplist.index)

    while True:
        max_val = 0
        min_val = 1000000
        min_list = 0
        min_index = 0
        for i in range(num_len):
            max_val = max(nums[i][list_dict[i]], max_val)
            if nums[i][list_dict[i]] < min_val:
                min_val = nums[i][list_dict[i]]
                min_list = i
                min_index = list_dict[i]

        if max_val - min_val < interval:
            begin = min_val
            end = max_val
            interval = max_val - min_val

        new_index = min_index + 1
        if new_index < len(nums[min_list]):
            list_dict[min_list] = new_index
        else:
            break

    return [begin, end]

